import React from "react";
import Edit from "./images/edit.svg";
import spin from "./images/bigspin.svg";
import tick from "./images/tick.svg";
import deleteSvg from "./images/Vector.svg";
const Task = ({ task, onDelete }) => {
  return (
    <div id="todo" className="todo">
      <label id="showName" key={task.id}>
        {task.name}
      </label>
      <div className="createdAt">
        <div>
          <label>created_at: {task.created_at}</label>
        </div>
        <div className="boxedButtonCompletedOn">
          <div /* className={blur} */>
            {
              /* !show && */ <button
                className="saveButton btn" /* onClick={togglehandler} */
              >
                Save
              </button>
            }
            {
              <button /* onClick={togglehandler} */ className="boxedButton ">
                <img src={tick} alt="tick" /* onClick={completeHandler} */ />
              </button>
            }
            {
              <button /* onClick={togglehandler} */ className="boxedButton ">
                <img src={Edit} alt="Edit" />
              </button>
            }
            <button className="boxedButton" onClick={() => onDelete(task.id)}>
              <img src={deleteSvg} alt="Delete" />
            </button>
          </div>

          {
            <label className="completedOn">
              completed_on: {task.completed_on}
            </label>
          }
        </div>
      </div>
    </div>
  );
};

export default Task;
